import './App.css';
import { Progress, Heading, CircularProgress, CircularProgressLabel } from '@chakra-ui/react';
import { createColumnHelper } from '@tanstack/react-table';
import { DataTable } from './DataTable';


const data = [
    {
        fromUnit: "inches",
        toUnit: "millimetres (mm)",
        factor: 25.4
    },
    {
        fromUnit: "feet",
        toUnit: "centimetres (cm)",
        factor: 30.48
    },
    {
        fromUnit: "yards",
        toUnit: "metres (m)",
        factor: 0.91444
    }
];

const columnHelper = createColumnHelper();

const columns = [
    columnHelper.accessor("fromUnit", {
        cell: (info) => info.getValue(),
        header: "To convert"
    }),
    columnHelper.accessor("toUnit", {
        cell: (info) => info.getValue(),
        header: "Into"
    }),
    columnHelper.accessor("factor", {
        cell: (info) => info.getValue(),
        header: "Multiply by",
        meta: {
            isNumeric: true
        }
    })
];


function App() {
    return (
        <div className="App">
            <header>
                <Heading>Make-It-All</Heading>
            </header>

            <div class="outer progress">
                <Heading size="lg">Projects</Heading>
                <div class="inner progress">
                    <div className='temp'>
                        <Heading size="md">Project 1</Heading>
                        <Progress colorScheme="red" hasStripe value={80}></Progress>
                    </div>
                    <div className='temp'>
                        <Heading size="md">Project 2</Heading>
                        <Progress colorScheme="cyan" hasStripe value={80}></Progress>
                    </div>
                    <div className='temp'>
                        <Heading size="md">Project 3</Heading>
                        <Progress colorScheme="blue" hasStripe value={80}></Progress>
                    </div>
                    <div className='temp'>
                        <Heading size="md">Project 4</Heading>
                        <Progress colorScheme="green" hasStripe value={80}></Progress>
                    </div>
                    <div className='temp'>
                        <Heading size="md">Project 5</Heading>
                        <Progress colorScheme="yellow" hasStripe value={80}></Progress>
                    </div>
                </div>
            </div>
            <div class="outer progressCircle">
                <Heading>Task</Heading>
                <div class="inner progressCircle">
                    <div>
                        <Heading size="md">Task</Heading>
                    </div>
                    <div class="circle">
                        <CircularProgress capIsRound color="red" size="300px" value={80} >
                            <CircularProgressLabel>80%</CircularProgressLabel>
                        </CircularProgress>
                    </div>
                </div>
            </div>
            <div class="outer employees">
                <Heading>Employees</Heading>
                <div class="inner employees">
                    <DataTable columns={columns} data={data} />
                </div>
            </div>
        </div>
    );
}

export default App;
